#include <bits/stdc++.h>
using namespace std;

typedef vector<string> vs; 

bool matcher(string s, string word){
    int mainIndex = 0;
    int wordIndex = 0;

    while (mainIndex < s.length() && wordIndex < word.length()){
        if (s[mainIndex] == word[wordIndex]){
            mainIndex++;
            wordIndex++;
        }
        else{
            mainIndex++;
        }
    }
    return (wordIndex == word.length()); 
}


int numMatchingSubseq(string s, vector<string>& words) {
    int count = 0;
    map<string, bool> m;
    for (int i=0; i< words.size(); i++){

        // if element in map
        if (m.find(words[i]) == m.end()){
            bool result = matcher(s, words[i]);
            if (result){
                m[words[i]] = true;
                count++;
            }
        }
        else{
            if (m[words[i]]){
                count++;
            }
        }
    }

    cout << "mapsize " << m.size() << endl;
    return count;
}

